[u]The Interview: Francis Fukuyama: How Did We Get Here?[/u]

How did our political system grow into what we have today? Author Francis Fukuyama on political order and the inevitability of conflict.

[b]Francis Fukuyama[/b] is an American political scientist, political economist, and author. His latest novel is titled [i]The Origins of Political Order[/i]. 

